import { IonCard, IonCardHeader, IonCardSubtitle, IonCardTitle } from '@ionic/react'
import React from 'react'
import './Card.scss'
import { pin, wifi, wine, warning, walk } from 'ionicons/icons';
interface CardProps {
    img:string,
    text:string,
    // sub:string
  }

export const MainDashboardCard:React.FC<CardProps> = ({text,img}) => {
    const sample_img = 'https://coolbackgrounds.io/images/backgrounds/white/pure-white-background-85a2a7fd.jpg'
    return(
        <div>
            <IonCard className="green-card" href={`/bookslot?query=${text}`}>
                <img alt="sample" width="50%" height="90px" src={img || sample_img} className="img-dash"/>
                {pin}
                <IonCardHeader>
                    <IonCardTitle className="text-size">{text}</IonCardTitle>
                    {/* <IonCardSubtitle className="subtitle">{sub}</IonCardSubtitle> */}
                </IonCardHeader>
            </IonCard>
        </div>
    )
}
